export const styles = {
  defaultButtonStyle: {
    alignItems: "center",
    backgroundColor: "transparent",
    borderRadius: 6,
    height: 50,
    justifyContent: "center",
    paddingHorizontal: 20,
    paddingVertical: 15,
  },
  defaultLabelStyle: {
    color: "#FFFFFF",
    fontFamily: "Gilroy_Bold",
    fontSize: 16,
  },
  defaultDisabledStyle: {
    backgroundColor: "#C9C9C9",
  }
};

export default styles;
